import React, { useEffect } from 'react';
import EditIcon from '@material-ui/icons/Edit';

class EditButton {
  handleClick = () => {
    console.log(this);
  };
  render() {
    return (
      <button onClick={this.handleClick()}>
        <EditIcon />
      </button>
    );
  }
}

export default EditButton;
